import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#ffa500',
      alignItems: 'center',
      justifyContent: 'center',
    },
    viewTitulo: {
      height:'10%',
      width:'100%',
      alignItems:'center',
      justifyContent:'center',
      backgroundColor:'blue'
    },
    textTitle: {
      fontSize:23,
    },
    viewInputsGeral:{
      height:'90%',
      width:'100%',
      alignItems: 'center',
      justifyContent: 'flex-start',
      gap:10,
    },
    viewInput:{
      height:'10%',
      width:'100%',
      alignItems: 'center',
      justifyContent: 'center',
      
    },
    textInput:{
      fontSize:19,
  
    },
    input:{
      borderWidth:1,
      borderColor:'#b87e14',
      height:'100%',
      width:'55%',
      borderRadius:10,
    }
  });
